import React from 'react';
import { makeStyles, createMuiTheme } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Button from '@material-ui/core/Button';
import Divider from '@material-ui/core/Divider';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import ListItemSecondaryAction from '@material-ui/core/ListItemSecondaryAction';
import IconButton from '@material-ui/core/IconButton';


const ProgramListItems = () => {
  const classes = useStyles();

  return(
    <List>
      <ListItem button >
       <ListItemText
       primary="2020 Acceleron Loyalty"
       secondary={
          <div>
            <div>SDACCL • Version 1.1 • 09/01/2019 - 08/31/2020</div>
            <div>TED: 5,323,000 USD • Type: Activity Incentive • Payee: Dealer/Retail • Program Communication Date: 01/01/2020</div>
          </div>
        }
      />
      <ListItemSecondaryAction>
        <IconButton edge="end" aria-label="morevert">
          <MoreVertIcon />
        </IconButton>
      </ListItemSecondaryAction>
     </ListItem>
     <Divider />
    </List>
  );
}

export default ProgramListItems;
